美容原液　スリーインワンクリームAP<br>
<br>
●商品特徴：<br>
「美容原液 3in1クリームAP 180g」は、クリームがとろけるように肌になじみ、美容成分を角質層に閉じこめ、長時間うるおう多機能クリームです。乳液、クリーム、美容液のはたらきをします。アルブチン、濃厚プラセンタ配合。輝くような透明感ある素肌に導きます。弱酸性、ノンアルコール、無香料、無着色、パラベンフリー。 <br>
<br>
●使用方法 <br>
お肌を清潔にした後、適量を手に取り気になる所に丁寧にぬりこみ、その後お顔全体に均等に延ばしてください。 <br>
<br>
●使用上の注意<br>
・傷・湿疹等お肌に異常があるときはご使用にならないでください。<br>
・ご使用中に赤み・かゆみ・刺激等の異常があらわれた場合は、ご使用を中止し、皮膚科専門医等へのご相談をおすすめします。そのままご使用を続けると、症状が悪化する恐れがあります。<br>
・目に入った時は、直ちに洗い流してください。<br>
・乳幼児の手の届かないところに保管してください。<br>
・高温多湿や低温の場所、直射日光の当たる場所には保管しないでください。 <br>
<br>
●原材料・成分：<br>
 水、グリセリン、スクワラン、ステアリン酸、ステアリルアルコール、トリ(カプリル酸/カプリン酸)グリセリル、アルブチン、プラセンタエキス、シア脂、ステアリン酸グリセリル、セテアリルアルコール、水酸化K、ジメチコン、キサンタンガム、EDTA-3Na、ポリソルベート60、フェノキシエタノール、メチルイソチアゾリノン <br>
<br>
●内容量：180g<br>
<br>
●メーカー：コスメテックスローランド株式会社 / COSMETEXROLAND　CO.,LTD.<br>
<br>
●製造国：日本<br>
<br>
JANコード：4936201056729<br>
商品区分：化粧品<br>
広告文責：蓮興商事株式会社 <br>
